import React from "react";
import "./Person.css";

const Person = (props) => {
  return (
    <div className="person">
      <p>My name is {props.person.name}</p>
      <p>I am {props.person.age} year old</p>
      <input
        type="text"
        onChange={props.changeHandler.bind(this, ev, props.person)}
        value={props.name}
      />
    </div>
  );
};

export default Person;
